window.bookSummaryJSON = "<p>\"Narrator Kate Reading's steady voice powers this exciting airship adventure...Reading also captures everyday life amid nations constantly at war, adrenaline-filled skirmishes and battles, and mind-numbing bureaucracy.\" â€” <i>AudioFile</i> Magazine </p> <p>Robyn Bennis' <i>The Guns Above</i> is an adventurous military fantasy debut about a nation's first female airship captain. </p> <p>They say it's not the fall that kills you. </p> <p>For Josette Dupre, the Corps' first female airship captain, it might just be a bullet in the back. </p> <p>On top of patrolling the front lines, she must also contend with a crew who doubts her expertise, a new airship that is an untested deathtrap, and the foppish aristocrat Lord Bernat, a gambler and shameless flirt with the military know-how of a thimble. Bernat's own secret assignment is to catalog her every moment of weakness and indecision. </p> <p>So when the enemy makes an unprecedented move that could turn the tide of the war, can Josette deal with Bernat, rally her crew, and survive long enough to prove herself? </p>"; 
